import React, { useState } from "react";
import axios from "axios";

function MitigationForm() {
  const [customerName, setCustomerName] = useState("");
  const [claimNumber, setClaimNumber] = useState("");
  const [insuranceStatus, setInsuranceStatus] = useState("Waiting on Insurance");

  const [rooms, setRooms] = useState([
    { name: "", moisture: "", details: "", notes: "", photos: [] },
  ]);

  const [dryLogs, setDryLogs] = useState([]);
  const [aiOutput, setAiOutput] = useState("");
  const [loadingAI, setLoadingAI] = useState(false);

  const addRoom = () => {
    setRooms([
      ...rooms,
      { name: "", moisture: "", details: "", notes: "", photos: [] },
    ]);
  };

  const updateRoom = (index, field, value) => {
    const newRooms = [...rooms];
    newRooms[index][field] = value;
    setRooms(newRooms);
  };

  const addDryLog = () => {
    setDryLogs([...dryLogs, { date: "", room: "", level: "" }]);
  };

  const updateDryLog = (i, field, value) => {
    const newLogs = [...dryLogs];
    newLogs[i][field] = value;
    setDryLogs(newLogs);
  };

  const generateAI = async () => {
    try {
      setLoadingAI(true);
      const response = await axios.post("http://localhost:5000/api/final-summary", {
        customerName,
        claimNumber,
        insuranceStatus,
        rooms,
        dryLogs,
      });

      setAiOutput(response.data.summary);
    } catch (err) {
      alert("AI Error â€“ backend not responding");
    } finally {
      setLoadingAI(false);
    }
  };

  return (
    <div className="section-card">

      {/* CUSTOMER INFO */}
      <h2>Customer Info</h2>
      <input placeholder="Customer Name" value={customerName}
        onChange={(e) => setCustomerName(e.target.value)} />
      <input placeholder="Claim Number" value={claimNumber}
        onChange={(e) => setClaimNumber(e.target.value)} />

      <select value={insuranceStatus}
        onChange={(e) => setInsuranceStatus(e.target.value)}>
        <option>Waiting on Insurance</option>
        <option>Customer Paid</option>
      </select>

      {/* ROOMS */}
      <h2>Rooms & Moisture Readings</h2>

      {rooms.map((room, index) => (
        <div className="room-card" key={index}>
          <input placeholder="Room Name" value={room.name}
            onChange={(e) => updateRoom(index, "name", e.target.value)} />

          <input placeholder="Moisture % (ex: 25% walls)" value={room.moisture}
            onChange={(e) => updateRoom(index, "moisture", e.target.value)} />

          <textarea placeholder="Moisture Reading Details"
            value={room.details}
            onChange={(e) => updateRoom(index, "details", e.target.value)} />

          <textarea placeholder="Room Notes (what was removed/dried)"
            value={room.notes}
            onChange={(e) => updateRoom(index, "notes", e.target.value)} />

          <input type="file" multiple
            onChange={(e) =>
              updateRoom(index, "photos", [...e.target.files])
            } />
        </div>
      ))}

      <button className="add-btn" onClick={addRoom}>+ Add Room</button>

      {/* DRY LOGS */}
      <h2>Daily Dry Log</h2>

      {dryLogs.map((log, i) => (
        <div className="drylog-card" key={i}>
          <input type="date" value={log.date}
            onChange={(e) => updateDryLog(i, "date", e.target.value)} />

          <input placeholder="Room" value={log.room}
            onChange={(e) => updateDryLog(i, "room", e.target.value)} />

          <input placeholder="Moisture Level (%)" value={log.level}
            onChange={(e) => updateDryLog(i, "level", e.target.value)} />
        </div>
      ))}

      <button className="add-btn" onClick={addDryLog}>+ Add Dry Log</button>

      {/* AI SUMMARY BUTTON */}
      <button className="generate-btn" onClick={generateAI} disabled={loadingAI}>
        {loadingAI ? "Generating..." : "âš¡ Generate AI Summary"}
      </button>

      {/* OUTPUT */}
      <textarea className="output-box"
        placeholder="AI summary will appear here..."
        value={aiOutput}
        readOnly
      />

      <button className="pdf-btn">
        ðŸ“„ Export PDF
      </button>

    </div>
  );
}

export default MitigationForm;
